import Phaser from "phaser";

export default class SlimeBuddyArea extends Phaser.Scene {

    preload() {
        this.load.spritesheet("slime", "../assets/slimeAnimations/slime_frames_all.png", {
            frameWidth: 16,
            frameHeight: 16
        })
    }

    create(){
        this.slime = this.add.sprite("slime")

        this.anims.create({
            key: "slimeIdle",
            frames: this.anims.generateFrameNumbers('slime'),
            frameRate: 10,
            repeat: -1
        })
        this.slime.play('slimeIdle')
    }
}
